import React from "react";
import ReactDOM from "react-dom/client";

import "./styles.css";

function App() {
  return (
    <div className="card">
      <Avatar />
      <div className="data">
        <Intro />

        <SkillList />
      </div>
    </div>
  );
}

function Avatar() {
  return <img className="avatar" src="sthita.jpeg" alt="Sthita Pragya" />;
}

function Intro() {
  return (
    <div>
      <h1> Sthita Pragya</h1>
      <p>
        Full Stack Web Developer and Software Engineer. Currently looking for a
        role as a Software/Web developer. Graduating in April,2025.
      </p>
    </div>
  );
}

function SkillList() {
  return <div className="skill-list">{SkillList.mao}</div>;
}

function Skill(props) {
  return (
    <div className="skill" style={{ backgroundColor: props.color }}>
      <span>{props.skill}</span>
      <span>{props.emoji}</span>
    </div>
  );
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

